Everything that is after a double slash on a line in JavaScript is a comment . Comments are ignored by the runtime and therefore have no effect for the execution of your program: // This is just a comment
// Comments have no effect
console.log('Hello, world!');
// Therefore this program is equivalent to the
// program from the previous chapter We will heavily utilize comments throughout this book inside the code blocks to highlight important ideas. There is a lot of discussion on how much you should comment your programs. We will return to this when discussing functions. However one rule is that if your code is so terrible that it requires extensive commentary to explain its behavior or purpose, you should fix the code. Just like a work of art, your code should stand on it's own merits. Imagine commenting a work of art (oh, wait)... However it is better to have terrible code and comments than have terrible code and no comments. We will also adopt the convention that if a comment is next to a line with a console.log statement, that comment shows the output that would be logged to the console if the code was run. For example: console.log('Hello, world!'); // Hello, world! This is the point where we tell you that while you are reading this book you should absolutely follow along in some runtime (probably Node.js, but a browser is fine too). This is very important . Go ahead and open a Node.js console now . Come on, we'll wait... ... ... ... Finally . Let's move on.

14.body:
Whenever we write programs, we need to manipulate data. This data needs to be stored somewhere and we need to be able to access it somehow. We also need to deal with the fact that when we execute a program, the values we deal with are not predictable in advance. For example we don't know which tasks a user might create. Nevertheless, we must be able to access created tasks through a predictable name like tasks or createdTasks. Therefore we need a way to put an unpredictable value in storage and refer to it using a predictable name. A variable is just that - a storage location containing a value which is referred to by a symbolic name. This sounds really fancy, but it just means that there is a value somewhere in your storage and you can refer to that value using a predictable name (even if the value itself is not predictable). For example you could have a variable x which has the value 5 (we say that x is equal to 5): Now even if the value of x changes (e.g. to 6), the variable name doesn't change, only the value does. That is the variable name is still x, however now x has the value 6 (i.e. x is equal to 6): JavaScript lets you declare variables with the let keyword. You can assign values to variables using the assignment operator (=): // Declare a variable
let x; // Assign a value to a variable
x = 10; We can print the value of the variable using the console.log method: console.log(x); // 10 If you follow along in the Node.js (or browser) console, you don't actually need to use the console.log method to print the value of a variable. Instead you can simply type the variable (or any expression for that matter) and the console will display its value. You can also have a declaration and an assignment on a single line. In fact, this is usually the way to go: let y = 10; The value of a variable may change over the course of a program: let y = 10;
console.log(y); // 10 // Assign a new value to the variable
y = 20;
console.log(y); // 20 This will print 10 first and then 20. If you want to declare a symbolic name for a value that never changes, you can declare a constant . This is done using the const keyword: const ten = 10; If you try to reassign a value to a constant, you get an error. For example if you do const ten = 10;
ten = 20; you get Uncaught TypeError: Assignment to constant variable. You will almost exclusively see us using const instead of let from now on. Reassignment is not nearly as necessary as you might think right now. You can also declare variables using the var keyword. We will not cover it here and you essentially only need to know one thing about var - you should basically never use it . It's mostly a historical artifact of the language at this point. Any variable has a data type which denotes the range of values it can take and which operations can be performed on the variable. You can use the typeof operator to obtain the data type of a variable. We begin with the primitive data types .

16.body:
Another primitive type is the Boolean type. This allows you to represent values which are either true or false: const thisBookIsAwesome = true;
const thisBookSucks = false;
console.log(typeof thisBookIsAwesome); // boolean
console.log(typeof thisBookSucks); // boolean You can do simple logic using the logical operators && (which denotes and ), || (which denotes or ) and ! (which denotes not ). The && ( and ) operator takes two values and evaluates to true only if both values are true and to false otherwise: console.log(true && true); // true
console.log(false && true); // false
console.log(true && false); // false
console.log(false && false); // false The || ( or ) operator takes two values and evaluates to true if at least one of the values is true (and to false otherwise): console.log(true || true); // true
console.log(false || true); // true
console.log(true || false); // true
console.log(false || false); // false The ! ( not ) operator takes a single value and simply negates it: console.log(!true); // false
console.log(!false); // true Here is an example with all the operators together: const b1 = true;
const b2 = false;
console.log(b1 && b2); // false
console.log(b1 || b2); // true
console.log(!b1); // false Note that technically all the logical operators can take any value (not just boolean values). The result of the logical operator application is then dependent on whether the values are truthy or falsy . We will discuss this a bit later. A boolean variable is usually the result of an expression. Often it is the result of an expression containing the equality operator (===) which allows us to compare the values of variables: const x1 = 5;
const x2 = 10;
const x3 = 5;
console.log(x1 === x1); // true
console.log(x1 === x2); // false
console.log(x1 === x3); // true There is also another equality operator (==). It can be best described as an April Fools' joke that somehow made it into the language. Never use it . If you want to write not equals you can use !==: console.log(5 !== 10); // true
console.log(5 !== 5); // false

