Another primitive data type is the String type. A string is simply a bunch of characters and is used to represent text. Strings are usually written using single quotes in JavaScript: const s = 'Some text';
console.log(typeof s); // string Note that it's also possible to write strings using double quotes, however in most projects strings are written using single quotes. We will stick to this convention. The + operator works on strings and does concatenation: const s1 = 'MERN ';
const s2 = 'book';
console.log(s1 + s2); // MERN book Note that instead of doing concatentation all the time you can also use template strings (also called template literals). This allows writing JavaScript expressions directly inside strings. Consider the following example: const s = 'world';
const greeting = `Hello ${s}!`;
console.log(greeting); // Hello world! Template strings are written using backticks ( not single quotes). They may contain so called placeholders which are expressions embedded inside ${...}. These expressions can be any valid JavaScript expression that evaluates to a value implicitly convertible to a string: console.log(`2 + 2 = ${2 + 2}`); // 2 + 2 = 4 You can get the length (i.e. the number of characters) of a string like this: const s = 'MERN book';
console.log(s.length); // 9

