Finally there is one more primitive type that is of interest to us, namely undefined. There is only one value of this type, which is also called undefined. If a variable has the value undefined this (quite logically) means that it hasn't been defined. For example, whenever you have a variable that has been initialized, but not assigned to, it will automatically have the value and therefore the type undefined. let someVariable;
console.log(someVariable); // undefined
console.log(typeof someVariable); // undefined Note that string, number, boolean and undefined are not the only primitive data types. Two other primitive data types are symbol and bigint. And there is one more primitive data type that we will encounter soon.

