Note that the condition does not necessary have to be boolean as JavaScript will automatically convert non-boolean values to booleans. For example you could write something like this: if (1) { console.log('1 is truthy.');
} else { console.log('1 is falsy.');
} This will print "1 is truthy." because JavaScript will consider 1 to be true in this context since 1 is a truthy value. Generally speaking, a truthy value is considered to be true when encountered in a boolean context (like a condition). A falsy value is considered to be false when encountered in a boolean context. The most important falsy values are false, 0, '' (empty string), null and undefined. Most other values (like 1, [] (empty array), [3], { example: 'hello' } etc) are truthy. Try to avoid using non-boolean values in boolean contexts as it can lead to surprising behaviour. Nevertheless it's still useful to know about truthiness and falsiness, as it will otherwise trip you up in certain cases.

