The ternary operator takes a condition , an expression to execute if the condition is truthy and an expression to execute if the condition is falsy . It looks like this: const doneMsg = 'All tasks are done';
const notDoneMsg = 'There are tasks left';
const msg = done ? doneMsg : notDoneMsg; The general form is: condition ? expression1 : expression2; There is a very common thing complete beginners do with ternary operators which looks like this: const finished = tasks.length === 0 ? true : false; You should stop for a second a think about why this is unneccessary. Thought about it? That's right. You can just write const finished = tasks.length === 0; Note that you cannot write arbitrary statements inside a ternary operator (and it wouldn't make a lot of sense anyway).

