Consider the following task object: const mernTask = { summary: 'Read the MERN book', description: 'Read and understand the MERN book', date: { day: 8, month: 6, year: 2022, },
}; Let's say we want to access the day of the task. We can do this by using mernTask.date.day. But what if the day does not have to be present, i.e. is optional ? This could e.g. happen because the user didn't enter a task. The object could look like this: const mernTask = { summary: 'Read the MERN book', description: 'Read and understand the MERN book',
