When programming we often have to perform some common actions over and over again. For example we might want to get the list of tasks assigned to a user at multiple parts within our software. Instead of writing code that (essentially) does the same thing multiple times we could use a function . Within the function definition we would specify what statements should be executed. Then we can write a function call (also called function invocation ). This would then actually execute the statements specified in the definition. We can simply group common actions into a function and then just call the function whenever we need the execute those actions. Here is a very simple function definition: function printGreeting() { console.log('Hello world!');
} Function definitions begin with the function keyword followed by the function name (in this case printGreeting). We will cover the meaning of the parentheses in a second, but the curly braces contain the body of the function. These are all the statements that will be executed when the function is called. In this case we have one statement, which will simply print Hello world! to the console. You can call / invoke the printGreeting function by writing printGreeting(): printGreeting(); // Hello world! You can of course have as many statements as you want inside the function body: function printGreetings() { console.log('Hello world!'); console.log('Hello again!');
} These functions are not particularly interesting since they do the exact same thing for every function call. In this case, we print the exact same greeting(s) every time. But what if we wanted to print a different greeting depending on the user (containing e.g. the user name)? We can solve this by defining function parameters . This allows us to pass values into the function, so that the function can adjust its behaviour. The function parameters go between the parentheses: function printGreeting(user) { console.log(`Hello ${user}!`);
} printGreeting('Jane'); // Hello Jane! In this example we have a single parameter called user. The function prints the greeting with the appropriate user. Within the function call we then pass the user (in this case Jane) as an argument to the function. We can also return values from functions using the return keyword. Here is a function that takes a number and returns the square of it: function square(num) { return num * num;
} We can now use the function as follows: const squaredNum = square(3);
console.log(squaredNum); // 9

