A variable is immutable if it is unchangeable. Otherwise we call it mutable . The more mutability we have inside our program the more can go wrong since it's hard to reason about (global) state. This is where the alert reader might interject - after all, isn't the purpose of a program to do something? And how can we achieve that if we don't change state? A fundamental correction is in order here - the purpose of every program is not to do something , but to manipulate data . You can of course manipulate data directly by mutating global state. Consider the following task object: const task = { id: 1, summary: 'Read the MERN book', description: 'Read and understand the MERN book.',
}; Now let's say we want to change the summary: task.summary = 'MERN book'; This works for simple objects and changes. But this will quickly become brittle with growing complexity. Reasoning about state and state changes is really hard. Instead we can create copies of the objects which contain the changes we need: const newTask = { ...task, summary: 'MERN book',
}; Note that we didn't change the original object, but created a copy of the object with a different summary. Immutability and pure functions are closely linked. You want to have immutable datastructures which get passed through pure functions to compute results.

