We already talked about the fact that JavaScript functions are just objects. We even showed an example of how you can assign a function to a variable: const square = (num) => num * num; However we can do much more. Since functions are just objects we can pass them to other functions. For example let's define a function that repeats some action n times: function repeat(fun, n) { for (let i = 0; i < n; i++) { fun(); }
} We can use it like this: const hello = () => console.log('Hello, world!');
repeat(hello, 4); This will output: Hello, world!
Hello, world!
Hello, world!
Hello, world! Note that the repeat function doesn't care what fun is - fun could be a simple console.log or a function which produces a simulated universe. All the repeat function does is it simply repeats fun the specified number of times. Functions which take (or return) functions are called higher-order functions .

