We now introduce the three most important higher-order functions - map, reduce and filter. These functions allow you to perform an incredibly rich set of operations on arrays. We want to use this blockquote to emphasize how often you will be using map, reduce and filter. We will use two running examples throughout the section - an array of numbers and an array of tasks: const numbers = [1, 2, 3, 4];
const tasks = [ { id: 1, summary: 'Read the MERN book', description: 'Read and understand the MERN book.', timeLogged: 60, status: 'In progress', }, { id: 2, summary: 'Write a task app', description: 'Write an awesome task app.', timeLogged: 0, status: 'Todo', }, { id: 3, summary: 'Think of a funny joke', description: 'Come up with a funny joke to lighten the mood.', timeLogged: 120, status: 'In progress', },
]; The map function takes one argument - a function f to apply to every element of the array. It returns the array resulting from applying f to every element of the original array. Let's say we wanted to square all the elements of numbers. We could write something like this: const result = [];
for (const number in numbers) { result.push(number ** 2);
} This is ugly and (you guessed it) tedious . Instead we can (and should) use the map function: const result = numbers.map((number) => number ** 2); The result array has the following content: [1, 4, 9, 16]; Consider another example. Let's say we wanted to add a long description to all the tasks based on the summary and the description. We can use the map function again: const longTasks = tasks.map((task) => ({ ...task, longDescription: `${task.summary}: ${task.description}`,
