]; The filter function allows you to select elements from an array based on some condition. It takes a function f which returns true or false for some input(s). All elements for which f returns true are kept, all elements for which f returns false are thrown away. A function which returns true or false is commonly referred to as a predicate . For example let's say we want to select all even elements from numbers. Here is the non-functional way: const result = [];
for (const number in numbers) { if (number % 2 === 0) { result.push(number ** 2); }
} Ugh! I don't even want to look at that. For loops and if statements all over the place. Let's rest our eyes and consider the functional approach: const result = numbers.filter((number) => number % 2 === 0); Consider another example - we might want to select all tasks from the tasks array which have the status 'Todo'. Think for a moment what the appropriate predicate would be. That's right, it looks like this: const todoTasks = tasks.filter((task) => task.status === 'Todo'); Finally there is the reduce function which (you guessed it) reduces an array to a single value. The reduce function moves over an array from left to right and keeps track of a current value . At every element of the array it recomputes the current value based on a function f (this is the first argument of the reduce function). The second argument of the reduce function is the initial value. Here is how we might compute the sum of an array: const sum = numbers.reduce((num, curr) => num + curr, 0); Let's say we would like to compute the total logged time (i.e. the time logged for all the tasks combined). This would look like this: const totalTime = tasks.reduce((task, curr) => task.loggedTime + curr, 0);

