When writing a web application, the most common way to get data from a server to a client is via the HTTP procotol (usually augmented by SSL resulting in the HTTPS procotol). HTTP is a request/response protocol , i.e. HTTP clients send requests to an HTTP server and receive a response in return. You have in fact already used the HTTP protocol. Every time you browse the internet, HTTP requests are sent under the hood. We could use the built-in HTTP module of Node.js, but this is not terribly convenient. Instead we will use an extremely popular framework called Express . While Express builts on top of the HTTP module, it provides a lot of additional useful functionality. Inside our root directory ( easy-opus in our case) create a directory named api . As usual this name can be something else, but it should be descriptive. Navigate inside the api directory and create a new Node.js project: npm init -y Install Express: npm install express Now create a file named app.js inside the api directory. As usual the name of the file is up to you, but it should be something meaningful. Inside the file we will create an Express application and then make that application listen for connections on a specified host and port. If you are very new to computer networks, a host is simply a device connected to some (computer) network. A port is a communication endpoint on that host. The concept of ports allows you to run multiple network applications on the same device. For example, your awesome website might run on port 80 and a service allowing you to remotely login onto your machine might run on port 22. This is how you can create an Express application and make it listen on port 3000: const express = require('express');
const app = express();
const PORT = 3000; app.listen(PORT, () => { console.log(`Server listening on port ${PORT}...`);
}); This application is not very useful, so let's add a route to it. Add this above the call to listen: app.get('/', (req, res) => { res.send('Hello, world!');
}); If you open a browser and navigate to (http://localhost:3000) you will see Hello, world! You can also use cURL, which includes a command-line tool for transferring data on a network. Among other things it supports HTTP and is available on both Windows and most Linux distributions. Open a command line and run: curl http://localhost:3000/ The will output the following: Hello, world!

