HTTP knows multiple request methods . We primarily care about two request methods for now - namely GET and POST . GET requests are generally used to retrieve data. Recall out route from above: app.get('/', (req, res) => { res.send('Hello world!');
}); This indicates that if a GET request is sent to path '/', we would like to return 'Hello, world!' to the client. The req is the request object and res is the respose object . If we want to send a HTTP response to the client we therefore use res.send. POST requests are generally used to send information to the server. For example a login request will generally be a POST request since it tells the server that a user has logged in to the application. Here we are less interested in the data the server returns us and more in telling the server that something happened. Note that we need to enable some middleware (we will return to the concept of middleware in a second): app.use(express.text()); Consider the following route which simply returns the request body back to the client: app.post('/post-example', (req, res) => { res.send(req.body);
}); How do we test this? You cannot simply send a POST request in a browser the way you would send a GET request. This is where curl comes in really handy. We need to specify that we want to send a POST request using the -X flag. In addition we specify the data that we want to send in the body of the POST request using the -d flag. Finally we specify a header called Content-Type and set it to text/plain. This indicates that the data we want to send is plain text. The final command looks like this: curl -X POST -H "Content-Type: text/plain" -d 'haha' http://localhost:3000/post-example Generally speaking GET requests transmit information using the querystring, while POST requests transmit information in the request body. Note that we will rarely send plain text in the request. Instead we will use a special format called JSON. This is a file format that supports a bunch of primitive values, arrays and dictionaries. A typical JSON could look like this: { "tasks": ["Task 1", "Task 2", "Task 3"], "date": { "year": 2022, "month": 06, "date": 18 }
} In order to accept JSON requests, we need to replace the express.text middleware with the express.json middleware: app.use(express.json()); Now we can curl the same path like this: curl -X POST -H "Content-Type: application/json" -d '{ "key": "value" }' http://localhost:3000/post-example Note that here we specify the application/json content type. This is all fine and dandy, but how do client and server know how to interpret all these things? The answer to that question is the IETF (short for Internet Engineering Task Force). This is an organization that sets standards for the Internet (hence the name). Among other things it is responsible for creating the various RFCs (Request for Comments) that outline the workings of HTTP. For example HTTP 1.1 (which is the most common HTTP version you will encounter at the time of this writing) is outlined in RFCs 7230-7235. URIs on the other hand are outlined in RFC 3986. We encourage you to have a quick look at the respective RFCs. You should definitely not read them all at this stage, but just understand the sheer complexity of the things we are discussing here. We are really just scratching a very tiny part of the surface of it all. Lucky for you, most of the RFCs will probably not be terribly relevant in your day-to-day life.

