Theoretically all the routes are in place now, but if you would submit this server for a review by your fellow developers, they would probably not approve of this (and not just because we are storing the tasks in a global variable instead of using a database). The reason for that is we have no error handling. Essentially our application assumes that the user of our API will submit only valid requests and nothing bad will ever happen. This is a terrible assumption to make and if you make this assumption, inevitable sleepless nights await you. We are dead serious. Programming that assumes nothing bad will ever happen is called happy path programming . The happy path is the "default" program workflow, where nothing exceptional happens. In our current implementation of the API we assume that the user will never do anything wrong, like trying to read a task with an ID that doesn't exist. But of course that will inevitably happen. Therefore let us make our API robust against such accidents. First, we should check that the ID the user is trying to view is valid. If the ID does not exist, we will return a response with status code 404, which means "Not found". app.get('/task/:id', (req, res) => { const taskId = req.params.id; if (!(id in tasks)) { res.sendStatus(404); } res.send(tasks[taskId]);
}); We will need similar checks when trying to update or delete an ID. This is the new PUT route: app.put('/task/:id', (req, res) => { const taskId = req.params.id; if (!(taskId in tasks)) { res.sendStatus(404); } tasks[taskId].summary = req.body.summary; tasks[taskId].description = req.body.description; res.send(tasks[taskId]);
}); And this is the new DELETE route: app.delete('/task/:id', (req, res) => { const taskId = req.params.id; if (!(taskId in tasks)) { res.sendStatus(404); } const deletedTask = tasks[taskId]; delete tasks[taskId]; res.send(deletedTask);
}); There is one more problem we need to address. Currently our POST and PUT requests assume that summary and description will always be present in the body. But what if the user submits a POST request without these fields? In that case the task will not be updated or created correctly. Therefore we should check for the presence of the summary and description fields in the POST body and return a status code 400 (Bad Request) in case these fields are missing. For example this is how the new and improved PUT request might look like: app.put('/task/:id', (req, res) => { const taskId = req.params.id; if (!(summary in req.body) or !(description in req.body)) { res.sendStatus(400); } if (!(taskId in tasks)) { res.sendStatus(404); } tasks[taskId].summary = req.body.summary; tasks[taskId].description = req.body.description; res.send(tasks[taskId]);
}); Later we will learn a more intelligent way to validate fields in POST request bodies without all this boilerplate, but for now this will do. We have a working API now (except for that thing with the global variable which we will replace in chapter 4)! Now our client has to actually use it, so let us go ahead and make some changes to the client.
